text:
when the accusations first came out i gave it a fair hearing.  at this point it's clear to me who the real victim is.  dr ford's testimony has 0 corroboratory evidence, the four witnesses she mentioned at the party deny it, and her story keeps changing as to how many people were in the room/ at the party.  she is not a reliable witness in the least, i also love how democrats think that mark judge is lying under oath to protect his friend but they ignore ford's best friend who says she didn't even know kavanaugh much less been to any party with him.  this whole witch hunt is such a sham and proof that the mob doesn't value due process and presumption of innocence, it all comes down to party politics and it's disgusting that this man's name has been tarnished forever because of it.  i sincerely hope this man gets on the supreme court, not because i am a big fan of his anti- 4th amendment beliefs, but for the sake of redemption and just retribution.
