#repostsave @washingtonpost with @repostsaveapp ・・・ as has been known to happen in trump news conferences, things took a turn on monday at the white house. after a statement on the newly reached trade deal between the united states, canada and mexico, the president opened the question-and-answer session by inexplicably deriding a female reporter. calling on abc’s @ceciliavegaabc for the first question, trump said: "she’s shocked that i picked her. she’s in a state of shock." vega responded: “i’m not, thank you, mr. president.” trump then said: “that’s ok, i know you’re not thinking. you never do.” vega responded again: "i’m sorry?" trump then told her to go ahead with her question. vega tried to ask about a trump tweet from this past weekend in which he denied reports that he was attempting to limit the scope of the fbi's investigation into the kavanaugh nomination, but the president responded "what does that have to do with trade?"
