text:
@metoo starting something at @nycwff: indeed, the opening event of the 11th annual food network & cooking channel new york city wine and food festival (11-14 oct.) is "supper is served." it honors the sisterhood doing its thing in food, #beverage and #hospitality ... at the center of an evening of fine food, drink and fellowship on 11 oct. will be metoo founder #taranaburke ... also on the bill: @ martinamcbride and @natashabedingfield. both will provide a little night music ... others participating in the supper include @giadadelaurentiis, @katieleekitchen and @rachaelray ...tickets are on sale now ... proceeds from nycwff benefit no kid hungry and the food bank for new york city ... photo credits: getty images for nycwff, martina mcbride website  and archive.
